type req map[string]interface{}

func createIdc(idc *Idc) error {

	body := req{
		"name":        idc.Name,
		"description": idc.Desc,
	}

	req, err := http.NewRequest("POST", fmt.Sprintf("%s/idcs", apiAddr), readerOf(body))
	if err != nil {
		return err
	}
	req.Header.Set("Content-Type", "application/json")
	resp, err := http.DefaultClient.Do(req)
	if err != nil {
		return err
	}
	defer resp.Body.Close()
	printResp("create idc reqp:"+idc.Name, resp.Body)
	return nil
}

