type group struct {
	Name string
	Ips  []*server
}

type groupW struct {
	Idc string
	Groups []*group
}

func parsePoolsGroup() (idcs map[string]bool,groups  map[string][]*server,poolGroups  map[string]*groupW,err  error) {
	res := map[string][]*server{}
	err = json.Unmarshal([]byte(groupServersUserd), &res)
	if err != nil {
		return
	}
	idcs = map[string]bool{}
	groups = map[string][]*server{}
	poolGroups = map[string]*groupW{}

	for groupName, servers := range res {
		idcServers := map[string][]*server{}
		var idc string
		for _, s := range servers {
			idcServers[s.Idc] = append(idcServers[s.Idc], s)
			idcs[s.Idc] = true
			idc = s.Idc
		}
		// 其中的机房数量大于1
		if len(idcServers) > 1 {
			for idc, ss := range idcServers {
				newgroupName := groupName + "--" + idc
				gw := poolGroups[groupName]
				if gw == nil{
					gw = &groupW{
						Idc:    idc,
						Groups: nil,
					}
					poolGroups[groupName] = gw
				}
				gw.Groups = append(gw.Groups,&group{
					Name: newgroupName,
					Ips:  ss,
				})
				poolGroups[newgroupName] = &groupW{
					Idc: idc,
					Groups: []*group{{
						Name: newgroupName,
						Ips:  ss,
					},
					},
				}
			}

		} else {
			poolGroups[groupName] = &groupW{
				Idc:    idc,
				Groups: []*group{{
					Name: groupName,
					Ips:  servers,
				},
				},
			}

		}

	}
	for s, _ := range idcs {
		fmt.Println(s)
	}
	fmt.Println("------------")

	bs, _ := json.Marshal(res)
	fmt.Println(string(bs))

	bs2, _ := json.Marshal(poolGroups)
	fmt.Println(string(bs2))



	return
}

