type param struct {
	Key string
	Val string
}

type rule struct {
	Host   string
	Params []param
	Rank int
}

func stringOfRules(rule []*rule)[]string{
	sss := []string{}
	for _, r := range rule {
		ss := []string{}
		for _, p := range r.Params {
			ss = append(ss,p.Key+"="+p.Val)
		}
		sss = append(sss,strings.Join(ss,"&"))
	}
	return sss
}

func doHttp(method string,url string,body interface{},args ...interface{})error{
	req ,err := http.NewRequest(method,url,readerOf(body))
	if err != nil{
		return err
	}
	req.Header.Set("Content-Type", "application/json")

	resp ,err := http.DefaultClient.Do(req)
	if err != nil{
		return err
	}
	defer resp.Body.Close()

	bs ,_ := ioutil.ReadAll(resp.Body)

	fmt.Println(fmt.Sprintln(args...),string(bs))
	return nil
}


