func readHostGroupRules()([]*service,[]*route,map[string]map[string]bool){
	hostRules := map[string]map[string]*groupElem{}
	err := json.Unmarshal([]byte(hostGroupRules),&hostRules)
	if err != nil{
		panic(err)
	}
	services := []*service{}
	params := map[string]map[string]bool{}
	routes := []*route{}
	for host, groups := range hostRules {
		for groupName, grls := range groups {
			serviceName := host+"--"+groupName
			services = append(services,&service{
				Name:serviceName,
				Pool: groupName,
				Ttl:  3600,
			})
			rankRules := map[int][]*rule{} // rule 按照rank 分类
			for _, rule := range grls.RuleRaw {
				rankRules[rule.Rank] = append(rankRules[rule.Rank],rule)
				for _, p := range rule.Params {
					vvs := params[p.Key]
					if vvs == nil{
						vvs = map[string]bool{}
						params[p.Key] = vvs
					}
					vvs[p.Val] = true
				}
			}

			for rk, rules := range rankRules {
				routes = append(routes,&route{
					Name:  fmt.Sprintf("%s",host)  ,
					Service: serviceName,
					Hosts:   []string{host},
					Rules: stringOfRules(rules),
					Priority: rk,
				})
			}

		}
	}
	return services,routes,params
}

type service struct {
	Name string
	Pool string
	Ttl int
}

type route struct {
	Name string
	Service string
	Hosts []string
	Rules []string
	Priority int
}
